func Or(predicates ...predicate.DefaultKpiSetting) predicate.DefaultKpiSetting {
	return predicate.DefaultKpiSetting(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.DefaultKpiSetting) predicate.DefaultKpiSetting {
	return predicate.DefaultKpiSetting(func(s *sql.Selector) {
		p(s.Not())
	})
}
